// import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className='App'>
    <Router>
      <Routes>
        <Route path='/' element= {<Home />} />
        <Route path='/projects' element= {<Projects />} />
        <Route path='/experience' element= {<Experience />} />

      </Routes>
    </Router>
  </div>

  );


}

export default App;
